import React from 'react';
import style from './recipe.module.css';


const Details =  (props) =>{

console.log(props.meal);
    return (

        <>
            <div className="container">
                <div className="row">
                    <img className={style.image} src={props.image} alt="" />

                </div>
                <div className="row">
                    <div className="col-6">
                        <div className="row"><div className="col-6"><div className={style.title}><p>{props.title}</p></div></div></div>

                        <div className="row"><div className="col-6"><div className={style.meal}><p>props.meal</p></div></div></div>
                        <div className="row"><div className="col-6"><div className={style.diet}><p>{props.diet}</p></div></div></div>

                        <div className="row"><div className="col-6"><div className={style.cuisine}><p>{props.cuisine}</p></div></div></div>

                    </div>
                </div>
            </div>
        </>
    );
}

export default Details;
